INSERT INTO `doctor_specializations` (`id`, `name`, `description`, `created_at`, `updated_at`) VALUES
('01je64zr71jff02trhzr0d7jnf', 'Odontologas', 'Dantų tvarkymo specialistas.', '2024-12-03 13:37:45', '2024-12-03 13:37:45'),
('01je654epbqn2tkc5dh9162kc9', 'Kardiologas', 'Širdies ir kraujagyslių sistemos ligų specialistas. Diagnozuoja ir gydo širdies nepakankamumą, širdies ritmo sutrikimus, arterinę hipertenziją ir kitas širdies ligas.', '2024-12-03 13:40:19', '2024-12-03 13:40:19'),
('01je654qve8z0hzqa87mnksvkx', 'Neurologas', 'Nervų sistemos ligų specialistas. Tiria ir gydo galvos skausmus, insultus, epilepsiją, Parkinsono ligą, daugialypę sklerozę ir kitas neurologines ligas.', '2024-12-03 13:40:28', '2024-12-03 13:40:28'),
('01je6550nk1n7adc2ghhfxtb32', 'Onkologas', 'Vėžio gydytojas. Diagnozuoja įvairių rūšių vėžį, skiria ir stebi gydymą (chemoterapija, radioterapija, chirurgija).', '2024-12-03 13:40:37', '2024-12-03 13:40:37'),
('01je65578301t5wv9z4jz7ba2t', 'Gastroenterologas', 'Virškinimo sistemos ligų specialistas. Gydo skrandžio opas, dirgliosios žarnos sindromą, kepenų ligas, kasos uždegimus ir kitas virškinimo trakto ligas.', '2024-12-03 13:40:44', '2024-12-03 13:40:44'),
('01je655dq9a7qkwgkegq4t6989', 'Pediatras', 'Vaikų ligų specialistas. Prižiūri vaikų sveikatą nuo gimimo iki paauglystės, diagnozuoja ir gydo vaikų ligas.', '2024-12-03 13:40:51', '2024-12-03 13:40:51'),
('01je655k7a37929pstbv9vjfhx', 'Psichiatras', 'Psichikos sutrikimų specialistas. Gydo depresiją, nerimą, šizofreniją, bipolinį sutrikimą ir kitas psichikos ligas.', '2024-12-03 13:40:56', '2024-12-03 13:40:56'),
('01je655svfcsts5g12s5v35mcf', 'Dermatologas', 'Odos ligų specialistas. Gydo egzemą, psoriazę, spuogus, odos vėžį ir kitas odos ligas.', '2024-12-03 13:41:03', '2024-12-03 13:41:03'),
('01je655zkwdhhzdamvch0qsf09', 'Endokrinologas', 'Endokrininės sistemos ligų specialistas. Gydo diabetą, skydliaukės ligas, augimo sutrikimus ir kitus hormoninius sutrikimus.', '2024-12-03 13:41:09', '2024-12-03 13:41:09'),
('01je6569jd8x1tb57t1gbynqc1', 'Otorinolaringologas (LOR gydytojas)', 'Ausų, nosies ir gerklės ligų specialistas. Gydo sinusitą, klausos sutrikimus, gerklės uždegimus ir kitas ENT sritis.', '2024-12-03 13:41:19', '2024-12-03 13:41:19'),
('01je656fxzpp5pbkw0mc1debjn', 'Radiologas', 'Medicininės vaizdinimo tyrimų specialistas. Atlieka rentgeno, kompiuterinės tomografijos, magnetinio rezonanso tomografijos tyrimus, interpretuoja gautus vaizdus ir padeda gydytojams diagnozuoti ligas.', '2024-12-03 13:41:26', '2024-12-03 13:41:26');
